let songlist = [
  { name: "Blended Together", showid: "1", songid: "2", quality: "36" },
  { name: "The Wave", showid: "1", songid: "1", quality: "26" },
  { name: "Ticket", showid: "1", songid: "3", quality: "51" },
];

export function getSonglist(id) {
  return songlist.find((setlist) => songlist.id === id);
}
